import logo from "./logo.svg";
import "./App.css";
import PaymentComponent from "./components/checkout";
function App() {
  return (
    <div >
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <PaymentComponent />
      </header>
    </div>
  );
}

export default App;
